import { FoodCard } from "./FoodCard";
import { useSelector } from "react-redux";

import classNames from "classnames/bind";
import styles from "./Main.module.scss";
import { foodsRemainingSelector } from "~/redux/selectors";
const cx = classNames.bind(styles);

function Main() {
  const foods = useSelector(foodsRemainingSelector);
  // console.log("[FOODS]", foods);
  return (
    <div className={cx("wrapper")}>
      {foods &&
        foods.map((food) => (
          <FoodCard
            key={food.id}
            id={food.id}
            name={food.name}
            diet={food.diet}
            recipe={food.recipe}
            ingredients={food.ingredients}
            userLiked={food.userLiked}
          />
        ))}
      {(!foods || foods.length === 0) && (
        <h1 className={cx("no-results")}>Không có món ăn phù hợp </h1>
      )}
    </div>
  );
}

export default Main;
